function decode(str) {
	const out = {};

	str.split(String.fromCharCode(31)).forEach(unit => {
		const ex = /([^:]+):(.+)/.exec(unit),
			data = {
				characters: [],
				ranges: [],
				hasRangeSurrogates: false
			};

		ex[2].split(" ").forEach(part => {
			const comps = part.split("!");

			switch (comps.length) {
				case 1:
					data.characters.push(fromBase92(comps[0]));
					break;

				case 2: {
					const start = fromBase92(comps[0]),
						end = fromBase92(comps[1]);

					if (start >= 0xffff || end >= 0xffff)
						data.hasRangeSurrogates = true;

					data.ranges.push([start, end]);
					break;
				}

				case 3: {
					const start = fromBase92(comps[0]),
						end = fromBase92(comps[2]),
						step = Number(comps[1]);

					for (let j = start; j <= end; j += step)
						data.characters.push(j);

					break;
				}
			}
		});

		const keys = ex[1].split(",");

		for (const key of keys)
			out[key] = data;
	});

	return out;
}

function fromBase92(str) {
	let out = 0,
		multiplicand = 1;

	for (let i = str.length - 1; i >= 0; i--) {
		out += (str.charCodeAt(i) - 35) * multiplicand;
		multiplicand *= 92;
	}

	return out;
}

